import { useState } from 'react';
import React from 'react'
import './Webdev.css'
import { Link } from 'react-router-dom'
//import axios from 'axios';
//import { BrowserRouter as Router,Switch, Route} from 'react-router-dom';
//import DSA from "./components/DSA.js"
//import Bargraph from "./components/Bargraph.js"
//import Linechart from "./components/Linechart"



function Webdev() {
    return (
      <div> 
          <h2 style={{marginLeft:"50px", fontSize:"50px"}}>Web Development</h2>
          <div style={{display:'flex'}}>
          <div className="webdev">
                <h2 style={{marginLeft:"50px"}}>Frontend Developer</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/frontend">Content</a>
                    </button>
                  </div>    
            </div>
            <div style={{display:'flex'}}>
              <div className="webdev">
              <h2 style={{marginLeft:"50px"}}>Backend Developer</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/backend">Content</a>
                    </button>
                  </div>    
              </div>
            </div>
          </div>



          <h2 style={{marginLeft:"50px", fontSize:"50px"}}>FrontEnd Development</h2>
          <div style={{display:'flex'}}>
          <div className="webdev">
                <h2 style={{marginLeft:"60px"}}>React</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/react">Content</a>
                    </button>
                  </div>    
            </div>
            <div style={{display:'flex'}}>
              <div className="webdev">
              <h2 style={{marginLeft:"50px"}}>Angular</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/angular">Content</a>
                    </button>
                  </div>    
              </div>
            </div>
          </div>



          <h2 style={{marginLeft:"50px", fontSize:"50px"}}>Backend Development</h2>
          <div style={{display:'flex'}}>
          <div className="webdev">
                <h2 style={{marginLeft:"50px"}}>Python</h2>
                <img src = {'data:image/jpeg;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/python">Content</a>
                    </button>
                  </div>    
            </div>
            <div className="webdev">
                <h2 style={{marginLeft:"50px"}}>Java</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/java">Content</a>
                    </button>
                  </div>    
            </div>
            <div style={{display:'flex'}}>
              <div className="webdev">
              <h2 style={{marginLeft:"50px"}}>Go</h2>
                <img src = {'data:image/png;base64,'} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/golang">Content</a>
                    </button>
                  </div>    
              </div>
            </div>
          </div>



          <h2 style={{marginLeft:"50px", fontSize:"50px"}}>Other Development</h2>
          <div style={{display:'flex'}}>
          <div className="webdev">
                <h2 style={{marginLeft:"40px"}}>DevOps Development</h2>
                <img src = {''} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/devops">Content</a>
                    </button>
                  </div>    
            </div>
            <div style={{display:'flex'}}>
              <div className="webdev">
              <h2 style={{marginLeft:"50px"}}>DSA Roadmap</h2>
                <img src = {''} alt=''/>
                <div className='btn'>
                    <button>
                      <a href="https://roadmap.sh/postgresql-dba">Content</a>
                    </button>
                  </div>    
              </div>
            </div>
          </div>
      </div>
    );
  }

export default Webdev;
